            DEOPT_IF(!PyFloat_CheckExact(right), COMPARE_AND_BRANCH);
            STAT_INC(COMPARE_AND_BRANCH, hit);
            double dleft = PyFloat_AS_DOUBLE(left);
            double dright = PyFloat_AS_DOUBLE(right);
